import React from "react";
import { Link } from "react-router-dom";

class BodyLotion extends React.Component {
  render() {
    return (
      <>
        <p>Shower  Page</p>
        <Link to="/">Go Home</Link>
      </>
    );
  }
}

export default BodyLotion;
